import React from 'react';
import styles from './houseinfo.module.css';
import InstagramEmbed from 'react-instagram-embed';

export default function HouseInfo() {

    const houses = [
        {
            id: 1,
            img: 'president.jpg',
            name: 'unster',
            namedafter: 'enry Dunster',
            facultydeans: 'Chen'
        }
    ];

    const houseList = houses.map(house => (
        <div className={styles.boxes}>
            <div className = {styles.box}>
                <div className = {styles.pics}><img src={house.img}></img></div>
                <div><p className = {styles.name}>Name</p><p className = {styles.bio}>{house.name}</p></div>
             </div>
        </div>

    ));

    return (
        <div>
            {houseList}
        </div>
    )

}





